import React from "react";
import "./blogs.css";
import BlogImg1 from "../../assets/images/busy-business-people-walking.jpg";
import DateImg from "../../assets/Blog1.png";

const Blogs = () => {
  return (
    <>
      <div className="blog-container">
        <div className="blog-head">
          <div className="blog-head-left">
            <div className="box">
              <div className="bar"></div>
              <span>Lastest Blogs</span>
            </div>
            <h2>
              We're here to share story <br /> from latest <span>news</span>
            </h2>
          </div>
          <div className="blog-head-right">
            <button className="primary-btn discover">View all blogs</button>
          </div>
        </div>
        <div className="blog-card-container">
          <BlogCard
            BlogImg={BlogImg1}
            BlogHeading={"Graphics"}
            DateImg={DateImg}
            date={"August 21, 2023"}
          />
        </div>
      </div>
    </>
  );
};
export default Blogs;

function BlogCard(props) {
  return (
    <>
      <div className="blog-card">
        <img src={props.BlogImg} alt="" />
        <div className="blog-topic">{props.BlogHeading}</div>
        <div className="blog-content">
          <div className="date">
            <img src={props.DateImg} alt="" />
            <span>{props.date}</span>
          </div>
        </div>
      </div>
    </>
  );
}
